rls my age, living at home and very far from all my college friends. The site is a space that feels so safe, open and intentionally and beautifully curated. From the profile setup where you choose the icon that represents you best to the fun pink backgrounds, it’s a space to give and get advice from an encouraging community of like-minded ladies!'),(2579,138,'_flexible_content_3_cards_0_body','field_605a940b92dc8'),(2580,138,'flexible_content_3_cards_0_author','edainko'),(2581,138,'_flexible_content_3_cards_0_author','field_605a942d92dc9'),(2582,138,'flexible_content_3_cards_0_icon','51'),(2583,138,'_flexible_content_3_cards_0_icon','field_605a944192dca'),(2584,138,'flexible_content_3_cards_1_body','I joined Girl Talk because I really missed being able to ask my friends for advice and this is everything I imagined it would be. I’ve gotten really helpful advice from other women here, and I love that I can see other questions people have asked. The site is so easy to navigate, I highly recommend Girl Tak to anyone who wants genione advice from people who care.'),(2585,138,'_flexible_content_3_cards_1_body','field_605a940b92dc8'),(2586,138,'flexible_content_3_cards_1_author','sweetcaroline'),(2587,138,'_flexible_content_3_cards_1_author','field_605a942d92dc9'),(2588,138,'flexible_content_3_cards_1_icon','52'),(2589,138,'_flexible_content_3_cards_1_icon','field_605a944192dca'),(2590,138,'flexible_content_3_cards','2'),(2591,138,'_flexible_content_3_cards','field_605a93f392dc7'),(2592,138,'footer_remove_wave','0'),(2593,138,'_footer_remove_wave','field_605e6265498d9'),(2594,139,'background_color','pink'),(2595,139,'_background_color','field_605904cec63fb'),(2596,139,'flexible_content','a:4:{i:0;s:4:\"hero\";i:1;s:11:\"intros_text\";i:2;s:13:\"rotating_text\";i:3;s:12:\"testimonials\";}'),(2597,139,'_flexible_content','field_605196a4055af'),(2598,139,'background_pink','0'),(2599,139,'_background_pink','field_605904cec63fb'),(2600,139,'flexible_content_0_header','A safe sp