 pandemic. It was tough to meet other poeple, expecially other girls my age, living at home and very far from all my college friends. The site is a space that feels so safe, open and intentionally and beautifully curated. From the profile setup where you choose the icon that represents you best to the fun pink backgrounds, it’s a space to give and get advice from an encouraging community of like-minded ladies!'),(2625,139,'_flexible_content_3_cards_0_body','field_605a940b92dc8'),(2626,139,'flexible_content_3_cards_0_author','edainko'),(2627,139,'_flexible_content_3_cards_0_author','field_605a942d92dc9'),(2628,139,'flexible_content_3_cards_0_icon','51'),(2629,139,'_flexible_content_3_cards_0_icon','field_605a944192dca'),(2630,139,'flexible_content_3_cards_1_body','I joined Girl Talk because I really missed being able to ask my friends for advice and this is everything I imagined it would be. I’ve gotten really helpful advice from other women here, and I love that I can see other questions people have asked. The site is so easy to navigate, I highly recommend Girl Tak to anyone who wants genione advice from people who care.'),(2631,139,'_flexible_content_3_cards_1_body','field_605a940b92dc8'),(2632,139,'flexible_content_3_cards_1_author','sweetcaroline'),(2633,139,'_flexible_content_3_cards_1_author','field_605a942d92dc9'),(2634,139,'flexible_content_3_cards_1_icon','52'),(2635,139,'_flexible_content_3_cards_1_icon','field_605a944192dca'),(2636,139,'flexible_content_3_cards','2'),(2637,139,'_flexible_content_3_cards','field_605a93f392dc7'),(2638,139,'footer_remove_wave','0'),(2639,139,'_footer_remove_wave','field_605e6265498d9'),(2640,140,'_wp_attached_file','2021/04/officeofwomenshealth-1.png'),(2641,140,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:312;s:6:\"height\";i:124;s:4:\"file\";s:34:\"2021/04/officeofwomenshealth-1.png\";s:5:\"sizes\";a:2:{s:6:\"medium\";a:4:{s:4:\"file\";s:34:\"officeofwomenshealth-1-300x119.png\";s:5:\"width\";i:300;s:6:\"height\";i:119;