 living at home during a pandemic. It was tough to meet other poeple, expecially other girls my age, living at home and very far from all my college friends. The site is a space that feels so safe, open and intentionally and beautifully curated. From the profile setup where you choose the icon that represents you best to the fun pink backgrounds, it’s a space to give and get advice from an encouraging community of like-minded ladies!'),(4044,239,'_flexible_content_3_cards_0_body','field_605a940b92dc8'),(4045,239,'flexible_content_3_cards_0_author','edainko'),(4046,239,'_flexible_content_3_cards_0_author','field_605a942d92dc9'),(4047,239,'flexible_content_3_cards_0_icon','51'),(4048,239,'_flexible_content_3_cards_0_icon','field_605a944192dca'),(4049,239,'flexible_content_3_cards_1_body','I joined Girl Talk because I really missed being able to ask my friends for advice and this is everything I imagined it would be. I’ve gotten really helpful advice from other women here, and I love that I can see other questions people have asked. The site is so easy to navigate, I highly recommend Girl Tak to anyone who wants genione advice from people who care.'),(4050,239,'_flexible_content_3_cards_1_body','field_605a940b92dc8'),(4051,239,'flexible_content_3_cards_1_author','sweetcaroline'),(4052,239,'_flexible_content_3_cards_1_author','field_605a942d92dc9'),(4053,239,'flexible_content_3_cards_1_icon','52'),(4054,239,'_flexible_content_3_cards_1_icon','field_605a944192dca'),(4055,239,'flexible_content_3_cards','2'),(4056,239,'_flexible_content_3_cards','field_605a93f392dc7'),(4057,239,'footer_remove_wave','0'),(4058,239,'_footer_remove_wave','field_605e6265498d9'),(4059,240,'_wp_attached_file','2021/04/Untitled-5.png'),(4060,240,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:600;s:6:\"height\";i:843;s:4:\"file\";s:22:\"2021/04/Untitled-5.png\";s:5:\"sizes\";a:2:{s:6:\"medium\";a:4:{s:4:\"file\";s:22:\"Untitled-5-214x300.png\";s:5:\"width\";i:214;s:6:\"height\";i:300;s:9:\"mime-t