1,266,'flexible_content_0_body','Hi, friend!\r\n\r\nThank you for being a part of the Girl Talk family. We are so glad you’re here.\r\n\r\nWe started Girl Talk as a way to alleviate the loneliness that we women feel as we progress through our lives. Did you know that Millennials are considered “the loneliest generation” and women are twice as likely to develop clinical depression as men?!\r\n\r\nWe thought we needed a space just for us to share advice, stories and of course, have our special “girl talk”. \r\n\r\nWe hope Girl Talk is a place where you feel less lonely.\r\n\r\nYour friend(s),\r\nEmily and the GT Team'),(4202,266,'_flexible_content_0_body','field_605e390135af4'),(4203,266,'flexible_content_0_image_profile','142'),(4204,266,'_flexible_content_0_image_profile','field_605e391235af5'),(4205,266,'flexible_content_1_title','Contact Us'),(4206,266,'_flexible_content_1_title','field_605e58136a23f'),(4207,266,'flexible_content_1_description','We would love to hear from you!'),(4208,266,'_flexible_content_1_description','field_605e581d6a240'),(4209,266,'flexible_content_1_cards_0_icon','144'),(4210,266,'_flexible_content_1_cards_0_icon','field_605e58516a244'),(4211,266,'flexible_content_1_cards_0_title','Questions?'),(4212,266,'_flexible_content_1_cards_0_title','field_605e583b6a242'),(4213,266,'flexible_content_1_cards_0_description_type','email'),(4214,266,'_flexible_content_1_cards_0_description_type','field_605e591a899a4'),(4215,266,'flexible_content_1_cards_0_email','hello@weneedtogirltalk.com'),(4216,266,'_flexible_content_1_cards_0_email','field_605e5987899a6'),(4217,266,'flexible_content_1_cards','3'),(4218,266,'_flexible_content_1_cards','field_605e582c6a241'),(4219,266,'flexible_content_1_cards_1_icon','264'),(4220,266,'_flexible_content_1_cards_1_icon','field_605e58516a244'),(4221,266,'flexible_content_1_cards_1_title','Press Inquiries'),(4222,266,'_flexible_content_1_cards_1_title','field_605e583b6a242'),(4223,266,'flexible_content_1_cards_1_descript