h {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Ipsum nunc aliquet bibendum enim facilisis. Purus viverra accumsan in nisl nisi scelerisque. Ligula ullamcorper malesuada proin libero. Nulla aliquet enim tortor at auctor urna nunc id cursus. Nunc faucibus a pellentesque sit amet. Et pharetra pharetra massa massa ultricies mi quis.</p>\n<!-- /wp:paragraph --></div></div></div></div></div>\n<!-- /wp:getwid/section -->','','','inherit','closed','closed','','14-autosave-v1','','','2021-03-16 16:06:46','2021-03-16 16:06:46','',14,'http://girl-talk.test/?p=16',0,'revision','',0),(18,1,'2021-03-17 05:19:05','2021-03-17 05:19:05','<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>asdasdasdasd</p><cite>asdasdasdasdadasdasd</cite></blockquote></figure>\n<!-- /wp:pullquote -->','Home','','inherit','closed','closed','','7-revision-v1','','','2021-03-17 05:19:05','2021-03-17 05:19:05','',7,'http://girl-talk.test/?p=18',0,'revision','',0),(19,1,'2021-03-17 05:28:39','2021-03-17 05:28:39','<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>asdasdasdasd</p><cite>asdasdasdasdadasdasd</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"33.33%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:33.33%\"><!-- wp:paragraph -->\n<p>sdasdasdasd</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"66.66%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:66.66%\"><!-- wp:image {\"id\":12,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://girl-talk.test/wp-content/uploads/2021/03/Vector-17-1024x421.png\" alt=\"\" class=\"wp-image-12\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','Home','','inherit','closed','closed','','7-revision-v1','','','2021-03-17 05:28:39','2021-03-17 05:28:39','',7,'http://girl-talk.test/?p=19',0,'revision','',0),(20,1,'2021-03-17 05:41:23','2021-03-17 05:41:23','','Home','','inherit','closed','closed','','7-revision-v1','','','2021-03-17 05:41:23','2021-03-17 05:41:23','',7,'http://girl-talk.test/?p=20',0,'revision','',0),(21,1,'2021-03-17 05:42:36','2021-03-17 05:42:36','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:13:\"post_template\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:20:\"flexible-content.php\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";a:10:{i:0;s:11:\"the_content\";i:1;s:7:\"excerpt\";i:2;s:10:\"discussion\";i:3;s:8:\"comments\";i:4;s:9:\"revisions\";i:5;s:6:\"format\";i:6;s:14:\"featured_image\";i:7;s:10:\"categories\";i:8;s:4:\"tags\";i:9;s:15:\"send-trackbacks\";}s:11:\"description\";s:0:\"\";}','Flexible Content','flexible-content','publish','closed','closed','','group_6051968e2077e','','','2021-03-17 05:42:36','2021-03-17 05:42:36','',0,'http://girl-talk.test/?post_type=acf-field-group&#038;p=21',0,'acf-field-group','',0),(22,1,'2021-03-17 05:42:36','2021-03-17 05:42:36','a:9:{s:4:\"type\";s:16:\"flexible_content\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:7:\"layouts\";a:1:{s:20:\"layout_605196bd85f94\";a:6:{s:3:\"key\";s:20:\"layout_605196bd85f94\";s:5:\"label\";s:0:\"\";s:4:\"name\";s:0:\"\";s:7:\"display\";s:5:\"block\";s:3:\"min\";s:0:\"\";s:3:\"max\";s:0:\"\";}}s:12:\"button_label\";s:11:\"Add Section\";s:3:\"min\";s:0:\"\";s:3:\"max\";s:0:\"\";}','Flexible Content','flexible_content','publish','closed','closed','','field_605196a4055af','','','2021-03-17 05:42:36','2021-03-17 05:42:36','',21,'http://girl-talk.test/?post_type=acf-field&p=22',0,'acf-field','',0),(24,1,'2021-03-23 00:57:26','2021-03-23 00:57:26','<strong>Girl Talk Content Policy</strong>\r\nEffective November 22, 2020. Last Updated November 22, 2020.\r\n\r\nGirl Talk is a safe connecting space that is populated by you, the Girl Talk users.\r\n\r\nThrough this community, you can post, comment, discuss, learn, debate, support, and connect with people who share your interests, and we encourage you to find comfort on Girl Talk.\r\n\r\nWhile not every topic, question, answer or reply may be for you (and you may find some unrelatable or even offensive), no question, answer or reply should be used as a weapon. Girl Talk should create a sense of belonging for their members, not try to diminish it for others. Likewise, everyone on Girl Talk should have an expectation of privacy and safety, so please respect the privacy and safety of others.\r\n\r\nThe Girl Talk community is defined by its users. Some of these users help manage the community as moderators. The culture of each community is shaped explicitly, by the community rules enforced by moderators. Please abide by the rules of the community in which you participate and do not interfere with others.\r\n\r\nBelow are the platform-wide rules that apply to everyone on Girl Talk. These rules are enforced by us, the admins.\r\n\r\nThe Girl Talk community is only what we make of it together, and can only exist if we operate by a shared set of rules. We ask that you abide by not just the letter of these rules, but the spirit as well.\r\n\r\nRules\r\n\r\n<span style=\"text-decoration: underline;\">Rule 1</span>\r\nRemember the human. Girl Talk is a place for creating community and belonging, not for attacking marginalized or vulnerable groups of people. Users have a right to use Girl Talk free of harassment, bullying, and threats of violence. Users that are unkind or incite violence will be banned.\r\n\r\n<span style=\"text-decoration: underline;\">Rule 2</span>\r\nRespect the privacy of others. Instigating harassment, for example by revealing someone’s personal or confidential information, is not allowed.\r\n\r\n<span style=\"text-decoration: underline;\">Rule 3</span>\r\nYou don’t have to use your real name to use Girl Talk, but don’t impersonate an individual or an entity in a misleading or deceptive manner.\r\n\r\n<span style=\"text-decoration: underline;\">Rule 4</span>\r\nKeep it legal, and avoid posting illegal content or soliciting or facilitating illegal or prohibited transactions.\r\n\r\n<span style=\"text-decoration: underline;\">Rule 5</span>\r\nDon’t break the site or do anything that interferes with normal use of Girl Talk.\r\n\r\nEnforcement\r\nWe have a variety of ways of enforcing our rules, including, but not limited to\r\n- Asking you nicely to cut it out\r\n- Asking you less nicely\r\n- Temporary or permanent suspension of account\r\n- Removal of content\r\n- Banning from site','Content Policy','','publish','closed','closed','','content-policy','','','2021-03-30 21:31:25','2021-03-30 21:31:25','',0,'http://girl-talk.guaodev.com/?page_id=24',0,'page','',0),(25,1,'2021-03-23 00:57:26','2021-03-23 00:57:26','','Content Policy','','inherit','closed','closed','','24-revision-v1','','','2021-03-23 00:57:26','2021-03-23 00:57:26','',24,'http://girl-talk.guaodev.com/?p=25',0,'revision','',0),(26,1,'2021-03-23 00:57:38','2021-03-23 00:57:38','<strong>Girl Talk Privacy Policy</strong>\r\nEffective November 22, 2020. Last Updated November 22, 2020.\r\n\r\nWe want you to understand how and why We Need to Girl Talk, LLC. (“Girl Talk,” “we” or “us”) collects, uses, and shares information about you when you use our sites, and other online products and services (collectively, the \"Services\") or when you otherwise interact with us or receive a communication from us.\r\nThis Privacy Policy applies to all of our Services.\r\n\r\nWhat We Collect (and How it is Used and Shared)\r\nInformation You Provide to Us\r\nWe collect information you provide to us directly when you use the Services. This includes:\r\n\r\nAccount information\r\n\r\nIf you create a Girl Talk account, we may require you to provide an email, username and password. Your username is public, and it doesn’t have to be related to your real name. You may also provide other account information, like an icon. We also store your user account preferences and settings.\r\n\r\nContent you submit\r\n\r\nWe collect the content you submit to the Services. This includes your posts and comments including saved drafts, your messages with other users (e.g., private messages), and your reports and other communications with moderators and with us. Your content may include text, links, images, gifs, and videos.\r\n\r\nActions you take\r\n\r\nWe collect information about the actions you take when using the Services. This includes your interactions with content, like posting and commenting. We collect your interactions, like your subscriptions or moderator status.\r\n\r\nTransactional information\r\n\r\nIf you purchase products or services from us (e.g., Girl Talk Premium), we will collect certain information from you, including your name, address, email address, and information about the product or service you are purchasing. Girl Talk uses industry-standard payment processor services (for example, Stripe) to handle payment information.\r\n\r\nOther information\r\n\r\nYou may choose to provide other information directly to us. For example, we may collect information when you fill out a form, participate in Girl Talk-sponsored activities or promotions, apply for a job, request customer support, or otherwise communicate with us.\r\n\r\nInformation We Collect Automatically\r\n\r\nWhen you access or use our Services, we may also automatically collect information about you. This includes:\r\n\r\nLog and usage data\r\n\r\nWe may log information when you access and use the Services. This may include your IP address, user-agent string, browser type, operating system, referral URLs, device information (e.g., device IDs), device settings, pages visited, links clicked, the requested URL, and search terms. Except for the IP address used to create your account, Girl Talk will delete any IP addresses collected after 100 days.\r\n\r\nLocation information\r\n\r\nWe may receive and process information about your location. We may also receive location information from you when you choose to share such information on our Services, including by associating your content with a location, or we may derive your approximate location from other information about you, including your IP address.\r\n\r\nInformation Collected from Other Sources\r\n\r\nWe may receive information about you from other sources, including from other users and third parties, and combine that information with the other information we have about you. For example, we may receive demographic or interest information about you from third parties, including advertisers (such as the fact that an advertiser is interested in showing you an ad), and combine it with our own data using a common account identifier such as a hash of an email address or a mobile-device ID. You can control how we use this information to personalize the Services for you as described in “Your Choices - Controlling Advertising and Analytics” below.\r\n\r\nLinked services\r\n\r\nIf you authorize or link a third-party service (e.g., an unofficial mobile app client) to access your account, Girl Talk receives information about your use of that service when it uses that authorization. Linking services may also cause the other service to send us information about your account with that service. For example, if you sign in to Girl Talk with a third-party identity provider, that provider may share an email address with us. To learn how information is shared with linked services, see “How Information About You Is Shared” below.\r\n\r\nInformation Collected by Third Parties\r\n\r\nEmbedded content\r\n\r\nGirl Talk displays some linked content in-line on the Girl Talk services via “embeds.” For example, Girl Talk posts that link to YouTube or Twitter may load the linked video or tweet within Girl Talk directly from those services to your device so you don’t have to leave Girl Talk to see it. In general, Girl Talk does not control how third-party services collect data when they serve you their content directly via these embeds. As a result, embedded content is not covered by this privacy policy but by the policies of the service from which the content is embedded.\r\n\r\nAudience measurement\r\n\r\nWe partner with audience measurement companies (including Quantcast) to learn demographic information about the population that uses Girl Talk. To provide this demographic information, these companies collect cookie information to recognize your device.\r\n\r\nWe use information about you to:\r\nProvide, maintain, and improve the Services;\r\nResearch and develop new services;\r\nHelp protect the safety of Girl Talk and our users, which includes blocking suspected spammers, addressing abuse, and enforcing the Girl Talk User Agreement and our other policies;\r\nSend you technical notices, updates, security alerts, invoices, and other support and administrative messages;\r\nProvide customer service;\r\nCommunicate with you about products, services, offers, promotions, and events, and provide other news and information we think will be of interest to you (for information about how to opt out of these communications, see “Your Choices” below);\r\nMonitor and analyze trends, usage, and activities in connection with our Services;\r\nMeasure the effectiveness of ads shown on our Services; and\r\nPersonalize the Services, and provide and optimize advertisements, content, and features that match user profiles or interests.\r\n\r\nWhen you submit content (including a post, or comment) users of our Services will be able to see that content, the username associated with the content, and the date and time you originally submitted the content.\r\nYour Girl Talk account has a profile page that is accessible to other users of the Services. Your profile contains information about your activities on the Services, such as your username, prior posts and comments, moderator status, Girl Talk Premium status.\r\n\r\nGirl Talk only shares nonpublic information about you in the following ways. We do not sell this information.\r\nWith your consent. We may share information about you with your consent or at your direction.\r\nWith linked services. If you link your Girl Talk account with a third-party service, Girl Talk will share the information you authorize with that third-party service. You can control this sharing as described in \"Your Choices\" below.\r\n\r\nWith our service providers. We may share information with vendors, consultants, and other service providers who need access to such information to carry out work for us. Their use of personal data will be subject to appropriate confidentiality and security measures. A few examples: (i) payment processors who process transactions on our behalf, (ii) cloud providers who host our data and our services, (iii) third-party ads measurement providers who help us and advertisers measure the performance of ads shown on our Services.\r\n\r\nTo comply with the law. We may share information in response to a request for information if we believe disclosure is in accordance with, or required by, any applicable law, regulation, legal process, or governmental request, including, but not limited to, meeting national security or law enforcement requirements. To the extent the law allows it, we will attempt to provide you with prior notice before disclosing your information in response to such a request.\r\nIn an emergency. We may share information if we believe it\'s necessary to prevent imminent and serious bodily harm to a person.\r\n\r\nTo enforce our policies and rights. We may share information if we believe your actions are inconsistent with our User Agreement, rules, or other Girl Talk policies, or to protect the rights, property, and safety of ourselves and others.\r\n\r\nWith our affiliates. We may share information between and among Girl Talk, and any of our parents, affiliates, subsidiaries, and other companies under common control and ownership.\r\nAggregated or de-identified information. We may share information about you that has been aggregated or anonymized such that it cannot reasonably be used to identify you.\r\n\r\nHow We Protect Your Information\r\nWe take measures to help protect information about you from loss, theft, misuse and unauthorized access, disclosure, alteration, and destruction. We also enforce technical and administrative access controls to limit which of our employees have access to nonpublic personal information.\r\nWe store the information we collect for as long as it is necessary for the purpose(s) for which we originally collected it. We may retain certain information for legitimate business purposes or as required by law.\r\n\r\nYour Choices\r\nYou have choices about how to protect and limit the collection, use, and sharing of information about you when you use the Services. Some of these choices are available to everyone who uses Girl Talk, while others only apply if you have a Girl Talk account.\r\n\r\nYour Rights\r\nData Subject and Consumer Information Requests\r\nRequests for a copy of the information Girl Talk has about your account can be submitted.\r\nAll other data subject and consumer requests under data protection laws should be sent via email to hello@weneedtogirltalk.com from the email address that you have verified with your Girl Talk account.\r\nBefore we process a request from you about your personal information, we need to verify the request via your access to your Girl Talk account or to a verified email address associated with your Girl Talk account. You may also designate an authorized agent to exercise these rights on your behalf. Girl Talk does not discriminate against users for exercising their rights under data protection laws to make requests regarding their personal information.\r\n\r\nAdditional Information for California Users\r\nThe California Consumer Privacy Act (“CCPA”) requires us to provide California residents with some additional information about the categories of personal information we collect and share, where we get that personal information, and how and why we use it.\r\nIf you are a California resident, you have additional rights under the CCPA, including the right to request access to or deletion of your personal information, and information about our data practices, as well as the right not to be discriminated against for exercising your privacy rights. These rights can be exercised as described in the Data Subject and Consumer Information Requests section above.\r\n\r\nChildren\r\nChildren under the age of 18 are not allowed to create an account or otherwise use the Services.\r\n\r\nChanges to This Policy\r\nWe may change this Privacy Policy from time to time. If we do, we will let you know by revising the date at the top of the policy. If the changes, in our sole discretion, are material, we may also notify you by sending an email to the address associated with your account (if you have chosen to provide an email address) or by otherwise providing notice through our Services. We encourage you to review the Privacy Policy whenever you access or use our Services or otherwise interact with us to stay informed about our information practices and the ways you can help protect your privacy. By continuing to use our Services after Privacy Policy changes go into effect, you agree to be bound by the revised policy.\r\n\r\nContact Us\r\nIf you have other questions about this Privacy Policy, please contact us at hello@weneedtogirltalk.com or at:\r\nWe Need to Girl Talk, LLC.\r\n15603 86th Way North\r\nWest Palm Beach, FL 33418','Privacy Policy','','publish','closed','closed','','privacy-policy','','','2021-03-30 21:32:23','2021-03-30 21:32:23','',0,'http://girl-talk.guaodev.com/?page_id