t expressly or implicitly endorse, support, or guarantee the completeness, truthfulness, accuracy, or reliability of any of Your Content.\r\nBy submitting Your Content to the Services, you represent and warrant that you have all rights, power, and authority necessary to grant the rights to Your Content contained within these Terms. Because you alone are responsible for Your Content, you may expose yourself to liability if you post or share Content without all necessary rights.\r\nYou retain any ownership rights you have in Your Content, but you grant Girl Talk the following license to use that Content:\r\nWhen Your Content is created with or submitted to the Services, you grant us a worldwide, royalty-free, perpetual, irrevocable, non-exclusive, transferable, and sublicensable license to use, copy, modify, adapt, prepare derivative works of, distribute, store, perform, and display Your Content and any name, username, voice, or likeness provided in connection with Your Content in all media formats and channels now known or later developed anywhere in the world. This license includes the right for us to make Your Content available for syndication, broadcast, distribution, or publication by other companies, organizations, or individuals who partner with Girl Talk. You also agree that we may remove metadata associated with Your Content, and you irrevocably waive any claims and assertions of moral rights or attribution with respect to Your Content.\r\nAny ideas, suggestions, and feedback about Girl Talk or our Services that you provide to us are entirely voluntary, and you agree that Girl Talk may use such ideas, suggestions, and feedback without compensation or obligation to you.\r\nAlthough we have no obligation to screen, edit, or monitor Your Content, we may, in our sole discretion, delete or remove Your Content at any time and for any reason, including for violating these Terms, violating our Content Policy, or if you otherwise create or are likely to create liability for us.\r\n\r\n5. Third-Party Content, Advertisements, and Promotions\r\nThe Services may contain links to third-party websites, products, or services, which may be posted by advertisers, our affiliates, our partners, or other users (“Third-Party Content”). Third-Party Content is not under our control, and we are not responsible for any third party’s websites, products, or services. Your use of Third-Party Content is at your own risk and you should make any investigation you feel necessary before proceeding with any transaction in connection with such Third-Party Content.\r\nThe Services may also contain sponsored Third-Party Content or advertisements. The type, degree, and targeting of advertisements are subject to change, and you acknowledge and agree that we may place advertisements in connection with the display of any Content or information on the Services, including Your Content.\r\n\r\n6. Things You Cannot Do\r\nWhen using or accessing Girl Talk, you must comply with these Terms and all applicable laws, rules, and regulations. Please review the Content Policy, which are part of these Terms and contain Girl Talk’s rules about prohibited content and conduct. In addition to what is prohibited in the Content Policy, you may not do any of the following:\r\nUse the Services in any manner that could interfere with, disable, disrupt, overburden, or otherwise impair the Services.\r\nGain access to (or attempt to gain access to) another user’s Account or any non-public portions of the Services, including the computer systems or networks connected to or used together with the Services.\r\nUpload, transmit, or distribute to or through the Services any viruses, worms, malicious code, or other software intended to interfere with the Services, including its security-related features.\r\nUse the Services to violate applicable law or infringe any person’s or entity\'s intellectual property rights or any other proprietary rights.\r\nAccess, search, or collect data from the Services by any means (automated or otherwise) except as permitted in these Terms or in a separate agreement with Girl Talk.\r\nUse the Services in any manner that we reasonably believe to be an abuse of or fraud on Girl Talk or any payment system.\r\nWe encourage you to report content or conduct that you believe violates these Terms or our Content Policy to hello@weneedtogirltalk.com. We also support the responsible reporting of security vulnerabilities. To report a security issue, please email hello@weneedtogirltalk.com.\r\n\r\n7. Copyright, Trademark, the DMCA, and Takedowns\r\nGirl Talk respects the intellectual property of others and requires that users of our Services do the same. We have a policy that includes the removal of any infringing material from the Services and for the termination, in appropriate circumstances, of users of our Services who are repeat infringers.If you believe that anything on our Services infringes a copyright or a trademark that you own or control, you may notify Girl Talk at hello@weneedtogirltalk.com.\r\nAlso, please note that if you knowingly misrepresent that any activity or material on our Service is infringing, you may be liable to Girl Talk for certain costs and damages.\r\nIf we remove Your Content in response to a copyright or trademark notice, we will notify you via the email you provided upon creating Your Account. If you believe Your Content was wrongly removed due to a mistake or misidentification in a copyright notice, you can send a counter notification to hello@weneedtogirltalk.com. Please see 17 U.S.C. § 512(g)(3) for the requirements of a proper counter notification.\r\n\r\n8. Indemnity\r\nExcept to the extent prohibited by law, you agree to defend, indemnify, and hold us, our directors, officers, employees, affiliates, agents, contractors, third-party service providers, and licensors (the “Girl Talk Entities”) harmless from any claim or demand, including costs and attorneys’ fees, made by any third party due to or