TATIONS OF THIS SECTION WILL APPLY TO ANY THEORY OF LIABILITY, INCLUDING THOSE BASED ON WARRANTY, CONTRACT, STATUTE, TORT (INCLUDING NEGLIGENCE) OR OTHERWISE, AND EVEN IF THE GIRL TALK ENTITIES HAVE BEEN ADVISED OF THE POSSIBILITY OF ANY SUCH DAMAGE, AND EVEN IF ANY REMEDY SET FORTH HEREIN IS FOUND TO HAVE FAILED ITS ESSENTIAL PURPOSE. THE FOREGOING LIMITATION OF LIABILITY WILL APPLY TO THE FULLEST EXTENT PERMITTED BY LAW IN THE APPLICABLE JURISDICTION.\r\n\r\n11. Governing Law and Venue\r\nWe want you to enjoy Girl Talk, so if you have an issue or dispute, you agree to raise it and try to resolve it with us informally. You can contact us with feedback and concerns at hello@weneedtogirltalk.com.\r\nExcept for the government entities listed below, any claims arising out of or relating to these Terms or the Services will be governed by the laws of Florida, without regard to its conflict of laws rules. All disputes related to these Terms or the Services will be brought solely in the federal or state courts located in West Palm Beach, Florida, and you consent to personal jurisdiction in these courts.\r\n\r\nGovernment Entities\r\nIf you are a U.S. city, county, or state government entity, then this Section 13 does not apply to you.\r\nIf you are a U.S. federal government entity, any claims arising out of or relating to these Terms or the Services will be governed by the laws of the United States of America without regard to its conflict of laws rules. To the extent permitted by federal law, the laws of Florida (other than its conflict of law rules) will apply in the absence of applicable federal law. All disputes related to these Terms or the Services will be brought solely in the federal or state courts located in West Palm Beach, Florida.\r\n\r\n12. Changes to these Terms\r\nWe may make changes to these Terms from time to time. If we make changes, we will post the revised Terms and update the Effective Date above. If the changes, in our sole discretion, are material, we may also notify you by sending an email to the address associated with your Account (if you have chosen to provide an email address) or by otherwise providing notice through our Services. By continuing to access or use the Services on or after the Effective Date of the revised Terms, you agree to be bound by the revised Terms. If you do not agree to the revised Terms, you must stop accessing and using our Services before the changes become effective.\r\n\r\n13. Additional Terms\r\nBecause we offer a variety of Services, you may be asked to agree to additional terms before using a specific product or service offered by Girl Talk (“Additional Terms”). To the extent any Additional Terms conflict with these Terms, the Additional Terms govern with respect to your use of the corresponding Service.\r\n\r\n14. Termination\r\nYou may terminate these Terms at any time and for any reason by deleting your Account and discontinuing use of all Services. If you stop using the Services without deactivating your Account, your Account may be deactivated due to prolonged inactivity.\r\nWe may suspend or terminate your Account, moderator status, or ability to access or use the Services at any time for any or no reason, including for violating these Terms or our Content Policy.\r\nThe following sections will survive any termination of these Terms or of your Account: 4 (Your Content), 6 (Things You Cannot Do), 10 (Indemnity), 11 (Disclaimers), 12 (Limitation of Liability), 13 (Governing Law and Venue), 16 (Termination), and 17 (Miscellaneous).\r\n\r\n15. Miscellaneous\r\nThese Terms constitute the entire agreement between you and us regarding your access to and use of the Services. Our failure to exercise or enforce any right or provision of these Terms will not operate as a waiver of such right or provision. If any provision of these Terms is, for any reason, held to be illegal, invalid, or unenforceable, the rest of the Terms will remain in effect. You may not assign or transfer any